INSERT INTO `lng_data` VALUES ('assessment','tst_results_presentation_description','en','If \"Show Pass Details for running tests\" is selected, the question titles and the reached points for every question in the test pass are available if the test is not finished. If \"Show Solutions in Test Results\" is selected, the detailed question solution is available for participants in the test results presentation. This includes the exact scoring of every answer, otherwise only an overview with the question titles and the reached points is shown. If the list of answers is selected, an overview of all questions with the answers of the participant is generated. This list will be offered on the Info Page and at the end of a test prior to the final submission. If \"Show Answer-Specific Feedback in Test Results\" is selected, the answer specific feedback will be shown in the test results next to the questions. If \"Results print view (answers only)\" is selected, the ILIAS content you place around a question using the \"Edit content\" tab page will not be visible in a print-out. If you want to save some paper space, select this option. If \"Show Signature Placeholder\" is selected, a signature placeholder will be shown for printout. If \"Show Suggested Solution\" is selected, the suggested solutions of questions (if existent) will be shown in the test results overview.',NULL,NULL);
