INSERT INTO `lng_data` VALUES ('assessment','tst_results_access_description','en','This setting handles the access of the participants to their test results. If results can be accessed after the test is finished, the participants can access their test results after they finished a test pass for the first time. Even if a test has more than one allowed test pass, the participants can access their test results after finishing the first pass. If you choose a date access restriction, the participants will not be able to access their test results until the specified date and time is reached. You must choose this option if you want to use the ECTS scoring system of if you have to score questions manually. If \"Always\" is selected, the participants can access their test results at any time even if the did not finish the test yet. If \"Never\" is selected, the access to test results is not available.',NULL,NULL);
