INSERT INTO `lng_modules` VALUES ('ldap','en','a:116:{s:16:\"ldap_add_missing\";s:20:\"Assign Missing Roles\";s:15:\"ldap_add_remove\";s:16:\"Add/Remove Roles\";s:22:\"ldap_add_role_ass_rule\";s:29:\"New Rule for Role Assignments\";s:20:\"ldap_assignment_type\";s:15:\"Assignment Type\";s:28:\"ldap_authentication_settings\";s:23:\"Authentication Settings\";s:19:\"ldap_bind_anonymous\";s:16:\"Bind Anonymously\";s:14:\"ldap_bind_user\";s:13:\"Bind as User:\";s:21:\"ldap_btn_add_role_ass\";s:12:\"Add New Rule\";s:26:\"ldap_check_role_assignment\";s:38:\"Assignment of Roles After Later Logins\";s:25:\"ldap_confirm_del_role_ass\";s:22:\"Delete Role Assignment\";s:25:\"ldap_deleted_role_mapping\";s:19:\"Deleted assignment.\";s:17:\"ldap_deleted_rule\";s:34:\"Deleted selected role assignments.\";s:12:\"ldap_dn_info\";s:47:\"Enter the distinguished name of the LDAP group.\";s:23:\"ldap_edit_role_ass_rule\";s:25:\"Edit Role Assignment Rule\";s:26:\"ldap_err_missing_plugin_id\";s:31:\"Please enter a valid plugin id.\";s:16:\"ldap_filter_info\";s:109:\"Filter that will be added to the search filter this way: (&(userattr=username)<strong>(userfilter)</strong>).\";s:27:\"ldap_global_role_assignment\";s:21:\"ILIAS-Role Assignment\";s:21:\"ldap_global_role_info\";s:173:\"Please choose an ILIAS Role new users will be assigned to. <span class=\"asterisk\">*</span> The role selection is <b>required</b> in case you chose a type of synchronisation.\";s:16:\"ldap_global_role\";s:11:\"Global Role\";s:25:\"ldap_group_attribute_info\";s:34:\"The group attribute to search for.\";s:20:\"ldap_group_attribute\";s:19:\"Attribute for Group\";s:18:\"ldap_group_dn_info\";s:53:\"Gets prepended to \"BaseDN\" when searching for groups.\";s:19:\"ldap_group_dn_short\";s:9:\"Group DN:\";s:13:\"ldap_group_dn\";s:8:\"Group DN\";s:22:\"ldap_group_filter_info\";s:147:\"Filter that will be added to the search filter when searching for a group: (&(groupattr=group)(memberattr=username)<strong>(groupfilter)</str