INSERT INTO `lng_modules` VALUES ('jsmath','en','a:12:{s:27:\"jsmath_default_setting_info\";s:169:\"If checked, jsMath will be used as default method to render LaTeX code for all users who did not enable or disable the jsMath support in their personal profile settings.\";s:22:\"jsmath_default_setting\";s:14:\"Use as default\";s:25:\"jsmath_enable_jsmath_info\";s:76:\"Activates support for jsMath based mathematical output of LaTeX expressions.\";s:20:\"jsmath_enable_jsmath\";s:13:\"Enable jsMath\";s:23:\"jsmath_enable_user_desc\";s:205:\"Activate jsMath for the output of mathematical formulae. jsMath output produces scaleable formulae and requires activated Javascript. When jsMath output is deactived, formulae will be rendered as graphics.\";s:18:\"jsmath_enable_user\";s:21:\"Enable jsMath support\";s:18:\"jsmath_extt_jsmath\";s:6:\"jsMath\";s:20:\"jsmath_no_javascript\";s:381:\"If you don\'t see the correct mathematical formula next to this hint, then you have jsMath output enabled but your web browser doesn\'t support JavaScript or JavaScript is disabled. To see mathematical formulae, please activate JavaScript in your web browser and reload this page or go to <strong>Personal Desktop &gt; Personal Profile &gt; jsMath</strong> and disable jsMath output.\";s:21:\"jsmath_path_not_found\";s:88:\"Cannot find jsMath.js in the given path. Please check the jsMath location on the server!\";s:26:\"jsmath_path_to_jsmath_desc\";s:121:\"The path to the jsMath base directory relative to the ILIAS base directory, e.g. &quot;./Services/Javascript/jsMath&quot;\";s:21:\"jsmath_path_to_jsmath\";s:14:\"Path to jsMath\";s:15:\"jsmath_settings\";s:15:\"jsMath Settings\";}');
