INSERT INTO `lng_modules` VALUES ('license','en','a:17:{s:9:\"arbitrary\";s:9:\"arbitrary\";s:24:\"course_licenses_exceeded\";s:144:\"By adding users the potential accesses will exceed the available licenses. Look at the tab \"Licenses\" to see which licenses have to be extended.\";s:20:\"course_licenses_rare\";s:130:\"Warning: only %s licenses are available for a course object. Look at the tab \"Licenses\" to see which licenses have to be extended.\";s:12:\"edit_license\";s:12:\"Edit license\";s:17:\"existing_licenses\";s:16:\"Existng licenses\";s:20:\"license_counter_info\";s:78:\"Allows to count the used licenses of purchased SCORM and HTML learning modules\";s:15:\"license_counter\";s:15:\"License counter\";s:15:\"license_updated\";s:29:\"The license data was updated.\";s:20:\"license_warning_info\";s:113:\"Up to this number of remaining licenses for a course object a warning is presented when a user enters the course.\";s:15:\"license_warning\";s:15:\"License warning\";s:30:\"potential_accesses_explanation\";s:84:\"Every user with read access who hasn\'t accessed so far counts as a potential access.\";s:18:\"potential_accesses\";s:18:\"Potential accesses\";s:30:\"remaining_licenses_explanation\";s:66:\"The available licenses are calculated as purchased minus consumed.\";s:18:\"remaining_licenses\";s:18:\"Available licenses\";s:25:\"used_licenses_explanation\";s:48:\"Every first access of a user consumes a license.\";s:13:\"used_licenses\";s:17:\"Consumed licenses\";s:25:\"zero_licenses_explanation\";s:38:\"Enter a 0 to deactivate the licensing.\";}');
