INSERT INTO `lng_modules` VALUES ('administration','en','a:246:{s:24:\"adm_item_cmd_asynch_info\";s:167:\"Action commands, e.g. in the repository, are loaded asynchronously. This increases performance in general, but slows down loading of action command lists a little bit.\";s:19:\"adm_item_cmd_asynch\";s:41:\"Load Resource Action Lists Asynchronously\";s:15:\"adm_locale_info\";s:155:\"Locale setting influences e.g. sorting in lists. Examples are nl_NL or de_DE. Multiple locales can be separated by comma. The first valid one will be used.\";s:10:\"adm_locale\";s:6:\"Locale\";s:30:\"adm_repository_cache_time_info\";s:157:\"Repository access cache time. Set 0 to disable the cache. Higher values may improve performance but also display actions that lead to a no-permission screen.\";s:25:\"adm_repository_cache_time\";s:21:\"Repository Cache Time\";s:22:\"allow_change_loginname\";s:47:\"Permit Change of Login Names in \'Personal Data\'\";s:16:\"analysis_options\";s:16:\"Analysis options\";s:12:\"analyze_data\";s:33:\"Analyze and repair data integrity\";s:24:\"analyzing_tree_structure\";s:27:\"Analyzing tree structure...\";s:9:\"analyzing\";s:12:\"Analyzing...\";s:28:\"auth_auth_mode_determination\";s:47:\"Authentication Method Determination (for Login)\";s:14:\"auth_automatic\";s:14:\"Fixed Sequence\";s:12:\"auth_by_user\";s:11:\"By the User\";s:23:\"auth_kind_determination\";s:21:\"Kind of Determination\";s:28:\"auth_mode_determination_info\";s:158:\"Choose either if the users have to select their authentication method on the login screen or if this is managed by a fixed sequence of authentication methods.\";s:15:\"check_tree_desc\";s:89:\"Check consistence of entire tree structure. Depending on tree size this may take a while!\";s:10:\"check_tree\";s:20:\"Check tree structure\";s:10:\"clean_desc\";s:78:\"Remove invalid references and tree entries. Initialize gaps in tree structure.\";s:5:\"clean\";s:8:\"Clean up\";s:14:\"cleaning_final\";s:17:\"Final cleaning...\";s:8: