e language\";s:20:\"language_scope_equal\";s:25:\"Equal to compare language\";s:21:\"language_scope_global\";s:11:\"All entries\";s:20:\"language_scope_local\";s:18:\"Local changes only\";s:24:\"language_scope_translate\";s:34:\"All entries, empty for translation\";s:24:\"language_scope_unchanged\";s:22:\"Unchanged entries only\";s:17:\"language_settings\";s:17:\"Language Settings\";s:19:\"language_statistics\";s:10:\"Statistics\";s:29:\"language_translation_disabled\";s:25:\"Page translation disabled\";s:28:\"language_translation_enabled\";s:24:\"Page translation enabled\";s:25:\"language_translation_mode\";s:16:\"Translation mode\";s:13:\"log_scan_desc\";s:61:\"Write scan results to \'scanlog.log\' in client data directory.\";s:8:\"log_scan\";s:16:\"Log scan results\";s:35:\"loginname_change_blocking_time_info\";s:139:\"Insert a period in days that an user has to wait before changing again its login name. If you enter 0, user can change login names anytime.\";s:46:\"loginname_change_blocking_time_invalidity_info\";s:30:\"Please insert a numeric value.\";s:30:\"loginname_change_blocking_time\";s:38:\"Blocking Time for Changing Login Names\";s:22:\"loginname_history_info\";s:130:\"If activated, login name changes will be logged in database. This history is accessible in the database table \'loginname_history\'.\";s:16:\"nothing_to_purge\";s:19:\"Nothing to purge...\";s:17:\"nothing_to_remove\";s:20:\"Nothing to remove...\";s:18:\"nothing_to_restore\";s:21:\"Nothing to restore...\";s:12:\"obj_mds_desc\";s:49:\"Configure Metadata and Advanced Metadata Settings\";s:7:\"obj_mds\";s:8:\"Metadata\";s:7:\"options\";s:7:\"Options\";s:14:\"output_options\";s:14:\"Output options\";s:20:\"passwd_auto_generate\";s:30:\"Password Forwarding/Generation\";s:15:\"path_to_mkisofs\";s:15:\"Path to mkisofs\";s:45:\"reuse_of_loginnames_contained_in_history_info\";s:128:\"If activated, it is allowed to reuse any login name that is already saved in the history (even if it belongs to a deleted user).\";s:20:\"purge_age_limit_desc\";s:115:\"If this field contains a value, only objects which were deleted before the specified number of days will be purged.\";s:15:\"purge_age_limit\";s:9:\"Limit age\";s:22:\"purge_count_limit_desc\";s:84:\"If this field contains a value, only the specified number of objects will be purged.\";s:17:\"purge_count_limit\";s:11:\"Limit count\";s:18:\"purge_missing_desc\";s:57:\"Remove all missing and unbound objects found from system.\";s:13:\"purge_missing\";s:21:\"Purge missing objects\";s:16:\"purge_trash_desc\";s:44:\"Remove all objects in trash bin from system.\";s:11:\"purge_trash\";s:21:\"Purge deleted objects\";s:21:\"purge_type_limit_desc\";s:82:\"If this field contains a value, only objects of the specified type will be purged.\";s:16:\"purge_type_limit\";s:10:\"Limit type\";s:20:\"purging_missing_objs\";s:26:\"Purging missing objects...\";s:13:\"purging_trash\";s:16:\"Purging trash...\";s:20:\"purging_unbound_objs\";s:26:\"Purging unbound objects...\";s:7:\"purging\";s:10:\"Purging...\";s:23:\"removing_invalid_childs\";s:32:\"Removing invalid tree entries...\";s:21:\"removing_invalid_refs\";s:30:\"Removing invalid references...\";s:22:\"removing_invalid_rolfs\";s:31:\"Removing invalid rolefolders...\";s:14:\"repair_options\";s:14:\"Repair options\";s:20:\"restore_missing_desc\";s:54:\"Restore missing and unbound objects to RecoveryFolder.\";s:15:\"restore_missing\";s:23:\"Restore missing objects\";s:18:\"restore_trash_desc\";s:51:\"Restore all objects in trash bin to RecoveryFolder.\";s:13:\"restore_trash\";s:23:\"Restore deleted objects\";s:22:\"restoring_missing_objs\";s:28:\"Restoring missing objects...\";s:15:\"restoring_trash\";s:18:\"Restoring trash...\";s:22:\"restoring_unbound_objs\";s:43:\"Restoring unbound objects and subobjects...\";s:9:\"restoring\";s:12:\"Restoring...\";s:40:\"reuse_of_loginnames_contained_in_history\";s:23:\"No Reuse of Login Names\";s:14:\"scan_completed\";s:14:\"Scan completed\";s:9