INSERT INTO `lng_modules` VALUES ('news','en','a:91:{s:19:\"news_1_file_created\";s:22:\"1 File has been added.\";s:19:\"news_1_file_updated\";s:24:\"1 File has been updated.\";s:15:\"news_1_postings\";s:25:\"1 Posting has been added.\";s:14:\"news_all_items\";s:38:\"News for all items on Personal Desktop\";s:30:\"news_allow_longer_periods_info\";s:57:\"Users may select longer news periods on personal desktop.\";s:25:\"news_allow_longer_periods\";s:20:\"Allow Longer Periods\";s:31:\"news_allow_shorter_periods_info\";s:58:\"Users may select shorter news periods on personal desktop.\";s:26:\"news_allow_shorter_periods\";s:21:\"Allow Shorter Periods\";s:22:\"news_block_information\";s:125:\"The <b>News</b> block lists all news that are related to the <b>Personal Items</b> you have selected on the personal desktop.\";s:27:\"news_block_news_for_context\";s:4:\"News\";s:15:\"news_cache_info\";s:132:\"Update news blocks all x minutes. \'0\' means everytime. Higher values improve performance, but news may link to non-accessible items.\";s:10:\"news_cache\";s:20:\"News Cache (Minutes)\";s:23:\"news_default_visibility\";s:14:\"Default Access\";s:23:\"news_edit_news_settings\";s:13:\"Edit Settings\";s:30:\"news_enable_internal_news_info\";s:148:\"Activates news blocks for categories, courses, groups and other objects. Users can subscribe to news and news are presented on the personal desktop.\";s:25:\"news_enable_internal_news\";s:20:\"Enable Internal News\";s:29:\"news_enable_internal_rss_info\";s:114:\"Allows to publish news items via RSS. These items will be accessible outside of the system without authentication.\";s:24:\"news_enable_internal_rss\";s:28:\"Enable RSS for Internal News\";s:29:\"news_enable_private_feed_info\";s:148:\"If this option is enabled, public and private news can be obtained by personal RSS feeds outside of ILIAS. Authentification is provided by password.\";s:24:\"news_enable_private_feed\";s:23:\"Enable private Newsfeed\";s:17:\"news_feed_url_for\";s:17:\"Feed URL for \'%s\'\";s:13:\"news_feed_url\";s:8:\"Feed URL\";s:38:\"news_first_letter_of_word_notification\";s:1:\"N\";s:18:\"news_get_feed_info\";s:211:\"This is a personal news feed URL. The feed includes only news that are declared as public by the author. The feed is not protected by any authentication procedure. Please do not share this URL with other people.\";s:19:\"news_get_feed_title\";s:17:\"Personal Feed URL\";s:17:\"news_get_feed_url\";s:12:\"Get Feed URL\";s:23:\"news_get_priv_feed_info\";s:307:\"This is a personal private news feed URL. The feed includes news that are declared as public and private by the author. This feed is protected by a password, which can be changed under \"Settings\". Please do not share this URL with other people. Please replace -password- in this URL with your Feed-Password.\";s:24:\"news_get_priv_feed_title\";s:25:\"Personal private Feed-URL\";s:22:\"news_hidden_news_block\";s:44:\"Block is currently hidden in learner\'s view.\";s:25:\"news_hide_news_block_info\";s:98:\"Hide block in learner\'s view. The news block will only be visible for users with write permission.\";s:20:\"news_hide_news_block\";s:15:\"Hide News Block\";s:19:\"news_hide_news_date\";s:13:\"Starting Date\";s:28:\"news_hide_news_per_date_info\";s:63:\"Only news that are newer than a certain date will be displayed.\";s:23:\"news_hide_news_per_date\";s:15:\"Show News After\";s:15:\"news_indefinite\";s:10:\"Indefinite\";s:18:\"news_internal_news\";s:4:\"News\";s:17:\"news_loading_news\";s:15:\"Loading News...\";s:32:\"news_news_item_content_long_info\";s:40:\"This text will not be published via RSS.\";s:27:\"news_news_item_content_long\";s:9:\"Long Text\";s:22:\"news_news_item_content\";s:4:\"Text\";s:19:\"news_news_item_head\";s:9:\"News Item\";s:20:\"news_news_item_title\";s:8:\"Headline\";s:30:\"news_news_item_visibility_info\";s:128:\"Public news can be accessed without authentication outside of ILIAS via RSS. Please do not include any confidential information.\";s:25:\"news_news_item_visibility\";s:6:\"Access\";s:15:\"news_news_items\";s:12:\"News Item(s)\";s:21:\"news_no_js_click_here\";s:38:\"If news are not displayed, click here.\";s:18:\"news_no_news_items\";s:18:\"No news available.\";s:30:\"news_notifications_public_info\";s:175:\"If this option is enabled, notifications can be obtained by personal RSS feeds outside of ILIAS. Please note that this makes notifications accessible without authentification.\";s:25:\"news_notifications_public\";s:20:\"Public Notifications\";s:18:\"news_notifications\";s:13:\"Notifications\";s:21:\"news_nr_of_items_info\";s:227:\"Number of news items that are kept for an object (e.g. a file or a learning module) in the database. Please note, that container objects (e.g. categories, courses) may list more items, because they aggregate news of subobjects.\";s:16:\"news_nr_of_items\";s:39:\"Number of Maximum News Items per Object\";s:19:\"news_pd_period_info\";s:127:\"Defines the time period used for news on the personal desktop. Select lower values, if you experience any performance problems.\";s:14:\"news_pd_period\";s:28:\"Personal Desktop News Period\";s:19:\"news_period_1_month\";s:10:\"Last Month\";s:18:\"news_period_1_week\";s:9:\"Last Week\";s:18:\"news_period_1_year\";s:9:\"Last Year\";s:18:\"news_period_x_days\";s:12:\"Last %s Days\";s:20:\"news_period_x_months\";s:14:\"Last %s Months\";s:19:\"news_period_x_weeks\";s:13:\"Last %s Weeks\";s:21:\"news_public_feed_info\";s:78:\"If this option is enabled, a separate RSS feed is provided for this Mediacast.\";s:16:\"news_public_feed\";s:14:\"Extra RSS Feed\";s:15:\"news_related_to\";s:10:\"Related To\";s:15:\"news_rss_period\";s:10:\"RSS Period\";s:13:\"news_settings\";s:13:\"News Settings\";s:14:\"news_subscribe\";s:9:\"Subscribe\";s:16:\"news_time_period\";s:11:\"Time Period\";s:16:\"news_unsubscribe\";s:11:\"Unsubscribe\";s:22:\"news_visibility_public\";s:6:\"Public\";s:21:\"news_visibility_users\";s:15:\"Logged in Users\