a\";s:11:\"Credit card\";s:29:\"pay_bmf_credit_card_not_valid\";s:110:\"The credit card data you\'ve entered isn\'t valid. Please check out whether all fields are filled out correctly.\";s:19:\"pay_bmf_credit_card\";s:11:\"Credit card\";s:24:\"pay_bmf_debit_entry_data\";s:11:\"Debit entry\";s:29:\"pay_bmf_debit_entry_not_valid\";s:110:\"The debit entry data you\'ve entered isn\'t valid. Please check out whether all fields are filled out correctly.\";s:19:\"pay_bmf_debit_entry\";s:39:\"Debit entry (german bank accounts only)\";s:31:\"pay_bmf_description_credit_card\";s:249:\"Please check out whether all articles you would like to order are in the shopping cart. By filling in your credit card data and clicking the \"Save\"-button you confirm your wish to order, that starts immediately. The data check may take some seconds.\";s:31:\"pay_bmf_description_debit_entry\";s:257:\"Please check out whether all articles you would like to order are in the shopping cart. By filling in your data for the debit entry and clicking the \"Save\"-button you confirm your wish to order, that starts immediately. The data check may take some seconds.\";s:32:\"pay_bmf_description_payment_type\";s:25:\"Please select how to pay.\";s:33:\"pay_bmf_description_personal_data\";s:46:\"Please fill out the following form completely.\";s:20:\"pay_bmf_house_number\";s:12:\"House number\";s:16:\"pay_bmf_optional\";s:8:\"optional\";s:10:\"pay_bmf_or\";s:2:\"or\";s:26:\"pay_bmf_password_not_valid\";s:27:\"Your password wasn\'t valid.\";s:30:\"pay_bmf_payment_type_not_valid\";s:76:\"The kind of paying you\'ve choosen isn\'t valid. Please select another option.\";s:20:\"pay_bmf_payment_type\";s:14:\"Kind of paying\";s:31:\"pay_bmf_personal_data_not_valid\";s:93:\"Your personal data isn\'t valid. Please check out whether all fields are filled out correctly.\";s:21:\"pay_bmf_personal_data\";s:18:\"Your personal data\";s:21:\"pay_bmf_please_select\";s:13:\"Please select\";s:14:\"pay_bmf_po_box\";s:6:\"PO Box\";s:25:\"pay_bmf_server_error_code\";s:33:\"Payment server returns error code\";s:34:\"pay_bmf_server_error_communication\";s:46:\"Error while communictaion with payment server.\";s:29:\"pay_bmf_server_error_sysadmin\";s:60:\"Please contact system administrator for further information.\";s:27:\"pay_bmf_shopping_cart_empty\";s:28:\"Your shopping card is empty.\";s:23:\"pay_bmf_street_or_pobox\";s:47:\"Please enter street and house number or po box.\";s:23:\"pay_bmf_subtotal_amount\";s:15:\"Subtotal amount\";s:29:\"pay_bmf_terms_conditions_read\";s:57:\"I\'ve read the general terms and conditions and accept it.\";s:29:\"pay_bmf_terms_conditions_show\";s:4:\"show\";s:24:\"pay_bmf_terms_conditions\";s:28:\"General terms and conditions\";s:14:\"pay_bmf_thanks\";s:36:\"Thank you. Your order was submitted.\";s:20:\"pay_bmf_total_amount\";s:12:\"Total amount\";s:16:\"pay_bmf_validity\";s:11:\"valid until\";s:20:\"pay_bmf_vat_included\";s:12:\"VAT included\";s:18:\"pay_bmf_your_order\";s:10:\"Your order\";s:16:\"pay_change_price\";s:33:\"Change price/duration combination\";s:16:\"pay_click_to_buy\";s:7:\"Buy now\";s:17:\"pay_confirm_order\";s:52:\"Please confirm your order by entering your password.\";s:28:\"pay_crs_max_members_exceeded\";s:83:\"You cannot buy this course because the maximum number of users is already exceeded.\";s:15:\"pay_customer_no\";s:12:\"Customer no.\";s:19:\"pay_deleted_booking\";s:27:\"The entry has been deleted.\";s:17:\"pay_deleted_items\";s:37:\"The selected items have been deleted.\";s:17:\"pay_edit_abstract\";s:13:\"Edit Abstract\";s:20:\"pay_enable_shop_info\";s:70:\"If activated the ILIAS webshop is available and objects can be bought.\";s:15:\"pay_enable_shop\";s:11:\"Enable Shop\";s:10:\"pay_ending\";s:9:\"ends with\";s:21:\"pay_entitled_retrieve\";s:29:\"Entitled to retrieve data for\";s:17:\"pay_epay_canceled\";s:25:\"The payment was canceled.\";s:16:\"pay_epay_success\";s:119:\"The payment has been processed. Please be aware that it can take a few minutes before your purchase is fully registred.\";s:16:\"pay_expires_info\";s:76:\"This object is disposable. The payment has been expired, you can not buy it.\";s:10:\"pay_filter\";s:6:\"Filter\";s:22:\"pay_goto_buyed_objects\";s:23:\"Goto your buyed objects\";s:22:\"pay_goto_shopping_cart\";s:22:\"Goto the shopping cart\";s:10:\"pay_header\";s:4:\"Shop\";s:29:\"pay_hide_advanced_search_info\";s:62:\"For simple shop with a few items hide the advanced search tab.\";s:24:\"pay_hide_advanced_search\";s:20:\"Hide Advanced Search\";s:21:\"pay_hide_coupons_info\";s:122:\"Hide coupons for the shopper. In case your shop is not using coupons this simplifies the buying process for your customer.\";s:16:\"pay_hide_coupons\";s:12:\"Hide coupons\";s:23:\"pay_hide_filtering_info\";s:40:\"Hide filtering options from the shopper.\";s:18:\"pay_hide_filtering\";s:14:\"Hide Filtering\";s:18:\"pay_hide_news_info\";s:58:\"Hides the shop news tab in case you\'re not using the news.\";s:13:\"pay_hide_news\";s:9:\"Hide news\";s:13:\"pay_hint_epay\";s:11:\"Tip to ePay\";s:15:\"pay_hint_paypal\";s:15:\"Hint for PayPal\";s:13:\"pay_info_epay\";s:110:\"When press \'pay\' the ePay payment window opens. After you have completed the payment you will return to ILIAS.\";s:15:\"pay_info_paypal\";s:401:\"To pay for those objects that are in your shopping cart you\'ll leave ILIAS temporary and head for the PayPal website. Please follow the steps that are shown to you there. After paying successfully you\'ll be directed back to ILIAS automatically. Don\'t close the window of your browser at any time whilst the selling process. Otherwise the objects you\'ve bought can\'t be activated for you automatically.\";s:8:\"pay_info\";s:310:\"Access to the following material is not for free. If you want to gain access to a certain learning object please select a price. You can purchase one or several learning objects by using the button \"shopping cart\" on your personal desktop.  You are going to gain immediate access to a chosen object and period.\";s:37:\"pay_item_already_in_sc_choose_another\";s:109:\"This object was already taken up in your shopping cart. Select if necessary a new price/duration combination.\";s:22:\"pay_item_already_in_sc\";s:49:\"This object already exists in your shopping cart.\";s:11:\"pay_locator\";s:4:\"Shop\";s:28:\"pay_manual_sorting_of_topics\";s:24:\"Manual Sorting of Topics\";s:17:\"pay_max_hits_info\";s:63:\"Please enter a number for the maximum number of search results.\";s:12:\"pay_max_hits\";s:8:\"Max hits\";s:22:\"pay_message_attachment\";s:79:\"As a confirmation for your order we send you a bill (PDF format) as attachment.\";s:17:\"pay_message_hello\";s:4:\"Dear\";s:19:\"pay_message_regards\";s:15:\"Yours sincerely\";s:19:\"pay_message_subject\";s:16:\"Your ILIAS order\";s:18:\"pay_message_thanks\";s:31:\"Thank you for your ILIAS order.\";s:22:\"pay_no_vendors_created\";s:18:\"No vendors created\";s:24:\"pay_not_buyed_any_object\";s:31:\"You have not bought any object.\";s:19:\"pay_order_date_from\";s:15:\"Order date from\";s:18:\"pay_order_date_til\";s:14:\"Order date til\";s:19:\"pay_order_paid_body\";s:76:\"Your invoice for %products% is attached this mail. Thank you for your order.\";s:22:\"pay_order_paid_subject\";s:12:\"Your invoice\";s:14:\"pay_payed_bill\";s:16:\"Rechnung bezahlt\";s:21:\"pay_payed_credit_card\";s:34:\"The order was paid by credit card.\";s:21:\"pay_payed_debit_entry\";s:34:\"The order was paid by debit entry.\";s:16:\"pay_payed_paypal\";s:29:\"The order was paid by PayPal.\";s:22:\"pay_paypal_error_fails\";s:58:\"PayPal reports errors that occured during the transaction.\";s:21:\"pay_paypal_error_info\";s:86:\"If necessary feel free to contact the system administrator of this ILIAS installation.\";s:30:\"pay_paypal_error_not_completed\";s:44:\"The transaction isn\'t totally completed yet.\";s:30:\"pay_paypal_error_prev_trans_id\";s:59:\"The transaction id given by PayPal was already used before.\";