INSERT INTO `lng_modules` VALUES ('registration','en','a:89:{s:21:\"auth_radius_name_desc\";s:50:\"Please choose a name for this server configuration\";s:16:\"auth_radius_name\";s:28:\"Name of RADIUS Configuration\";s:23:\"auth_radius_role_select\";s:5:\"Role:\";s:21:\"auth_radius_sync_info\";s:91:\"If enabled new user accounts will be created automatically after successful authentication.\";s:16:\"auth_radius_sync\";s:20:\"User Synchronization\";s:34:\"reg_access_limitation_limited_time\";s:29:\"After registration access for\";s:35:\"reg_access_limitation_limited_until\";s:23:\"Access is limited until\";s:34:\"reg_access_limitation_missing_mode\";s:53:\"Please choose for all roles an Access Limitation Mode\";s:35:\"reg_access_limitation_mode_absolute\";s:33:\"Access is limited by a fixed date\";s:35:\"reg_access_limitation_mode_relative\";s:57:\"Limited access for a fixed time period after registration\";s:36:\"reg_access_limitation_mode_unlimited\";s:20:\"No access limitation\";s:26:\"reg_access_limitation_mode\";s:22:\"Access Limitation Mode\";s:26:\"reg_access_limitation_none\";s:16:\"Unlimited access\";s:33:\"reg_access_limitation_out_of_date\";s:53:\"One or more Roles have an outdated access limitation!\";s:22:\"reg_access_limitations\";s:17:\"Access Limitation\";s:37:\"reg_activation_your_confirmation_link\";s:23:\"Your confirmation link:\";s:18:\"reg_add_assignment\";s:14:\"New Assignment\";s:20:\"reg_added_assignment\";s:21:\"Added new assignment.\";s:16:\"reg_approve_info\";s:76:\"If checked any new user registration has to be approved by an administrator.\";s:27:\"reg_approve_needs_recipient\";s:148:\"You should define minimum one user who will be notified about new registrations, if the registration type \"Registration with Approvement\" is chosen.\";s:11:\"reg_approve\";s:29:\"Registration with Approvement\";s:19:\"reg_available_roles\";s:16:\"Available Roles:\";s:39:\"reg_confirmation_hash_life_time_expired\";s:66:\"The confirmation link is not valid anymore. Please register again!\";s:36:\"reg_confirmation_hash_life_time_info\";s:86:\"Enter the lifetime (seconds) of confirmation links. Recommended value is 1800 seconds.\";s:31:\"reg_confirmation_hash_not_found\";s:59:\"No user account could be matched to this confirmation link.\";s:32:\"reg_confirmation_hash_not_passed\";s:46:\"The confirmation link was not entirely passed.\";s:32:\"reg_confirmation_link_successful\";s:300:\"You successfully submitted an account request to ILIAS. You will receive a confirmation e-mail in the next minutes. Please confirm your registration by clicking the confirmation link in this mail.<br />You will be redirected to the <a href=\"%s\" title=\"login screen\">login screen</a> after 20 seconds.\";s:11:\"reg_default\";s:7:\"Default\";s:22:\"reg_deleted_assignment\";s:22:\"Deleted assignment(s).\";s:15:\"reg_direct_info\";s:80:\"If this is checked, any new user registration request is automatically approved.\";s:10:\"reg_direct\";s:19:\"Direct Registration\";s:12:\"reg_disabled\";s:24:\"No Registration Possible\";s:10:\"reg_domain\";s:6:\"Domain\";s:25:\"reg_email_role_assignment\";s:25:\"Role Assignment By Domain\";s:9:\"reg_email\";s:25:\"Automatic Role Assignment\";s:29:\"reg_enable_access_limitations\";s:24:\"Enable Access Limitation\";s:9:\"reg_fixed\";s:29:\"Selection From Specified List\";s:12:\"reg_info_pwd\";s:76:\"If enabled passwords will be send automatically to the new users per E-Mail.\";s:21:\"reg_mail_body_approve\";s:149:\"You already have registered to ILIAS eLearning and received a e-mail with your account data. Now your account has been activated by an administrator.\";s:26:\"reg_mail_body_confirmation\";s:90:\"To confirm this registration enter the ILIAS user administration and activate the account.\";s:29:\"reg_mail_body_profile_changed\";s:26:\"your profile has changed !\";s:21:\"reg_mail_body_profile\";s:13:\"Profile data:\";s:28:\"reg_mail_body_pwd_generation\";s:153:\"Your account request will be reviewed by an administrator, and should be activated within 48 hours. You will be informed about the approvement by e-mail.\";s:20:\"reg_mail_body_reason\";s:131:\"You receive mail from ILIAS because notifications about new registrations are enabled for your account in the ILIAS administration.\";s:22:\"reg_mail_new_user_body\";s:31:\"a new user has been registered.\";s:17:\"reg_mail_new_user\";s:21:\"New user registration\";s:18:\"reg_missing_domain\";s:27:\"Please fill out all fields.\";s:16:\"reg_missing_role\";s:27:\"Please fill out all fields.\";s:21:\"reg_notification_info\";s:117:\"Enter one or more Login-Ids of users (comma seperated) that will be informed about new user registrations per e-mail.\";s:16:\"reg_notification\";s:13:\"Notifications\";s:27:\"reg_role_access_limitations\";s:59:\"Define access limitations of Roles for new registered Users\";s:19:\"reg_role_assignment\";s:15:\"Role Assignment\";s:13:\"reg_role_info\";s:14:\"Assigned Roles\";s:14:\"reg_select_one\";s:24:\"Please select one entry.\";s:20:\"reg_selectable_roles\";s:16:\"Selectable Roles\";s:19:\"reg_settings_header\";s:25:\"New Registration Settings\";s:26:\"reg_type_confirmation_info\";s:186:\"This type allows self-registration of users but requires an email confirmation to activate the account. This avoids self-registration to ILIAS with wrong or non-existant email addresses.\";s:21:\"reg_type_confirmation\";s:37:\"Registration with E-Mail Confirmation\";s:8:\"reg_type\";s:17:\"Registration Type\";s:22:\"reg_unknown_recipients\";s:35:\"The following logins are not valid:\";s:21:\"registration_settings\";s:17:\"New Registrations\";s:34:\"registration_user_new_account_mail\";s:21:\"Edit New Account Mail\";s:25:\"registration_tab_settings\";s:21:\"Registration Settings\";s:22:\"registration_tab_codes\";s:18:\"Registration Codes\";s:27:\"registration_reg_type_codes\";s:23:\"Registration with Codes\";s:32:\"registration_reg_type_codes_info\";s:70:\"This type allows self-registration of users but requires a valid code.\";s:22:\"registration_codes_add\";s:9:\"Add Codes\";s:25:\"registration_codes_export\";s:12:\"Export Codes\";s:30:\"registration_codes_edit_header\";s:9:\"Add Codes\";s:25:\"registration_codes_number\";s:15:\"Number Of Codes\";s:24:\"registration_codes_roles\";s:21:\"Role For New Accounts\";s:17:\"registration_code\";s:4:\"Code\";s:22:\"registration_generated\";s:18:\"Date Of Generation\";s:17:\"registration_used\";s:13:\"Date Of Usage\";s:22:\"registration_roles_all\";s:9:\"All Roles\";s:26:\"registration_generated_all\";s:9:\"All Dates\";s:33:\"registration_export_codes_no_data\";s:33:\"No codes to export were selected.\";s:27:\"registration_code_not_valid\";s:71:\"The given registration code is either invalid or already has been used.\";s:31:\"reg_confirmation_hash_life_time\";s:8:\"Lifetime\";s:15:\"reg_allow_codes\";s:11:\"Allow Codes\";s:20:\"reg_allow_codes_info\";s:45:\"Users are also allowed to register via codes.\";s:25:\"registration_code_no_role\";s:117:\"The registration code given does not specify a role and can not be used currently. Please contact your administrator.\";s:26:\"registration_no_valid_role\";s:85:\"There is currently no valid role for new accounts. Please contact your administrator.\";s:31:\"registration_code_optional_info\";s:58:\"If you have got a registration code, please enter it here.\";s:31:\"registration_code_required_info\";s:61:\"A pre-defined code is mandatory for the registration process.\";s:27:\"registration_code_role_info\";s:81:\"If you use a registration code, the role selection may be superseded by the code.\";s:17:\"reg_email_domains\";s:49:\"The following email address domains are valid: %s\";s:19:\"reg_allowed_domains\";s:29:\"Allowed Email Address Domains\";s:24:\"reg_allowed_domains_info\";s:37:\"Use * as wildcard and ; as separator.\";}');
INSERT INTO `lng_modules` VALUES ('rep','en','a:25:{s:9:\"rep_intro\";s:26:\"Welcome to the Repository!\";s:10:\"rep_intro1\";s:247:\"In this area you can create learning and working resources for all users. All resources are organised in categories. Categories can reflect the structure of your organisation (e.g. departments), a hierarchie of disciplines, or classes of a school.\";s:10:\"rep_intro2\";s:53:\"Three steps are needed to build an initial structure:\";s:10:\"rep_intro3\";s:74:\"Click on the <i>%s</i> button besides the selection list on the top right.\";s:10:\"rep_intro4\";s:79:\"In the following form, enter a title and a description, and click on <i>%s</i>.\";s:10:\"rep_intro5\";s:65:\"By clicking on the title of the category you enter your category.\";s:10:\"rep_intro6\";s:83:\"After that procedure you may add any learning or working resource to your category.\";s:16:\"rep_dependencies\";s:12:\"Dependencies\";s:20:\"rep_object_to_delete\";s:9:\"To Delete\";s:20:\"rep_dependent_object\";s:25:\"Ressource with dependence\";s:14:\"rep_dependency\";s:10:\"Dependency\";s:27:\"rep_no_permission_to_delete\";s:23:\"No permission to delete\";s:36:\"rep_object_references_cannot_be_read\";s:38:\"No permissions for %s more references.\";s:37:\"rep_multiple_reference_deletion_intro\";s:41:\"Further references exist for this object.\";s:43:\"rep_multiple_reference_deletion_instruction\";s:52:\"Please select the ones which should also be deleted:\";s:27:\"rep_activation_availability\";s:12:\"Availability\";s:21:\"rep_activation_online\";s:6:\"Online\";s:21:\"rep_activation_access\";s:6:\"Access\";s:28:\"rep_activation_limited_start\";s:13:\"Starting Time\";s:26:\"rep_activation_limited_end\";s:11:\"Ending Time\";s:33:\"rep_activation_limited_visibility\";s:14:\"Always Visible\";s:24:\"rep_visibility_limitless\";s:9:\"Unlimited\";s:20:\"rep_visibility_until\";s:21:\"Temporarily Available\";s:33:\"rep_activation_online_object_info\";s:54:\"This setting affects all references in the repository.\";s:30:\"rep_activation_access_ref_info\";s:72:\"This setting only affects this and no other reference in the repository.\";}');
