"usrimport_global_role_for_action_required\";s:61:\"At least one global role must be specified for \"%1$s\" action.\";s:21:\"usrimport_ignore_role\";s:11:\"Ignore role\";s:29:\"usrimport_login_is_not_unique\";s:20:\"Login is not unique.\";s:38:\"usrimport_no_insert_ext_account_exists\";s:63:\"Can\'t perform \"Insert\" action. External account already exists.\";s:38:\"usrimport_no_update_ext_account_exists\";s:63:\"Can\'t perform \"Update\" action. External account already exists.\";s:43:\"usrimport_with_specified_role_not_permitted\";s:41:\"Import with specified role not permitted.\";s:31:\"usrimport_xml_attribute_missing\";s:46:\"Attribute \"%2$s\" in element \"%1$s\" is missing.\";s:37:\"usrimport_xml_attribute_value_illegal\";s:62:\"Value \"%3$s\" of attribute \"%2$s\" in element \"%1$s\" is illegal.\";s:42:\"usrimport_xml_attribute_value_inapplicable\";s:85:\"Value \"%3$s\" of attribute \"%2$s\" in element \"%1$s\" is inapplicable for \"%4$s\" action.\";s:37:\"usrimport_xml_element_content_illegal\";s:44:\"Content \"%2$s\" of element \"%1$s\" is illegal.\";s:41:\"usrimport_xml_element_for_action_required\";s:51:\"Element \"%1$s\" must be specified for \"%2$s\" action.\";s:34:\"usrimport_xml_element_inapplicable\";s:49:\"Element \"%1$s\" is inapplicable for \"%2$s\" action.\";s:5:\"valid\";s:5:\"Valid\";s:8:\"validate\";s:8:\"Validate\";s:5:\"value\";s:5:\"Value\";s:14:\"vcard_download\";s:22:\"Download Visiting Card\";s:5:\"vcard\";s:13:\"Visiting Card\";s:7:\"vendors\";s:7:\"Vendors\";s:19:\"verification_failed\";s:19:\"Verification failed\";s:24:\"verification_failure_log\";s:24:\"Verification failure log\";s:16:\"verification_log\";s:16:\"Verification log\";s:24:\"verification_warning_log\";s:24:\"Verification warning log\";s:7:\"version\";s:7:\"Version\";s:8:\"versions\";s:8:\"Versions\";s:12:\"view_content\";s:12:\"View Content\";s:4:\"view\";s:4:\"View\";s:14:\"visible_layers\";s:14:\"Visible Layers\";s:20:\"visible_registration\";s:23:\"Visible in Registration\";s:7:\"visible\";s:7:\"Visible\";s:7:\"visitor\";s:7:\"Visitor\";s:8:\"visitors\";s:8:\"Visitors\";s:6:\"visits\";s:6:\"Visits\";s:13:\"web_resources\";s:8:\"Weblinks\";s:28:\"webdav_pear_auth_http_needed\";s:127:\"You need to install Pear Auth_HTTP to use this function. To do this, enter <code>pear install Auth_HTTP</code> on the terminal.\";s:6:\"webdav\";s:6:\"WebDAV\";s:18:\"webfolder_dir_info\";s:122:\"You got here, because your browser can\'t open webfolders. Read the <a href=\"%1$s\">instructions for opening webfolders</a>.\";s:18:\"webfolder_index_of\";s:13:\"Index of %1$s\";s:27:\"webfolder_instructions_info\";s:479:\"The webfolder instructions are shown on browsers, which can not open a webfolder directly. You can use HTML code, and the following placeholders: <b>[WEBFOLDER_TITLE]</b>, <b>[WEBFOLDER_URI]</b>, <b>[WEBFOLDER_URI_IE]</b>, <b>[WEBFOLDER_URI_KONQUEROR]</b>, <b>[WEBFOLDER_URI_NAUTILUS]</b>, <b>[ADMIN_MAIL]</b>, <b>[IF_WINDOWS]</b>...<b>[/IF_WINDOWS]</b>, <b>[IF_MAC]</b>...<b>[/IF_MAC]</b>, <b>[IF_LINUX]</b>...<b>[/IF_LINUX]</b>. Clear the field to get the default instructions.\";s:27:\"webfolder_instructions_text\";s:2796:\"<p>Follow the instructions below, to open <b>[WEBFOLDER_TITLE]</b> as a webfolder:</p>[IF_WINDOWS]<h3>Instructions for Windows Vista</h3><ol><li>Press the key combination Windows+E to open Windows Explorer.</li><li>Click on \'Add Network Place\' in the toolbar.<br/>The \'Add a Network Place\' wizard will open.</li><li>Click at the link \'Connect to a website\'.</li><li>Select the \'Choose Another Network Location\' option, and select \'Next\'.<li>In the \'Internet or Network Address\' field enter<br/><b>[WEBFOLDER_URI]</b><br/>then select \'Next\'.</li><li>Enter your login and password, and select \'OK\'.<br/>Repeat this step until you get to the next dialog window.</li><li>Enter a name for the webfolder, then select \'Next\'.<li>Enter your login and password, and select \'OK\'.<br/>Repeat this step until you get to the next dialog window.</li><li>Select \'Finish\'.</li><li>You can now access the webfolder from the start menu \'Computer\'.</li></ol><h3>Instructions for Windows XP</h3><ol><li>Press the key combination Windows+E to open Windows Explorer.</li><li>Choose the menu \'Extras &gt; Add Network Place...\'.<br/>The \'Add a Network Place\' wizard will open.</li><li>Click at the link \'Connect to a website ...\'.<br/>The assistant window will open.</li><li>Select \'Next\'.</li><li>Select the \'Choose Another Network Location\' option, and select \'Next\'.<li>In the \'Internet or Network Address\' field enter<br/><b>[WEBFOLDER_URI]</b><br/>then select \'Next\'.</li><li>Enter your login and password, and select \'OK\'.<li>Enter a name for the webfolder, then select \'Next\'.<li>Enter your login and password, and select \'OK\'.</li><li>Select \'Finish\'.</li><li>This will open the webfolder. You can later access the webfolder from the start menu \'Network places\' again.</li></ol>[/IF_WINDOWS][IF_MAC]<h3>Instructions for Mac OS X</h3><ol><li>Open the Finder</li><li>Choose the menu \'Go &gt; Connect to Server...\'<br/>The \'Connect to Server\' dialog will open.</li><li>In the address field enter the following address:<br/><b>[WEBFOLDER_URI]</b><br/>and select \'Connect\'.</li><li>Enter your login and password, and select \'OK\'.</li></ol>[/IF_MAC][IF_LINUX]<h3>Instructions for Linux with Konqueror</h3><ol><li>Start the Konqueror browser</li><li>In the address field enter the following address:<br/><b>[WEBFOLDER_URI_KONQUEROR]</b></li><li>Press the Enter key.</li><li>Enter your login and password, and select \'OK\'.</li></ol><h3>Instructions for Linux with Nautilus</h3><ol><li>Start the Nautilus browser</li><li>In the address field enter the following address:<br/><b>[WEBFOLDER_URI_NAUTILUS]</b></li><li>Press the Enter key.</li><li>Enter your login and password, and select \'OK\'.</li></ol>[/IF_LINUX]<p>If opening the webfolder does not work, please contact <a href=\"mailto:[ADMIN_MAIL]\">[ADMIN_MAIL]</a>.</p>\";s:32:\"webfolder_instructions_titletext\";s:22:\"Open %1$s as webfolder\";s:22:\"webfolder_instructions\";s:22:\"Webfolder instructions\";s:24:\"webfolder_mount_dir_with\";s:167:\"Open this page as a Webfolder with <a href=\"%1$s\">Internet Explorer 6</a>, <a href=\"%2$s\">Konqueror</a>, <a href=\"%3$s\">Nautilus</a>, <a href=\"%4$s\">other Browser</a>.\";s:9:\"webfolder\";s:9:\"Webfolder\";s:11:\"webr_active\";s:6:\"Active\";s:13:\"webr_add_item\";s:11:\"Add Weblink\";s:8:\"webr_add\";s:11:\"Add Weblink\";s:17:\"webr_delete_items\";s:17:\"Delete Weblink(s)\";s:18:\"webr_deleted_items\";s:19:\"Deleted Weblink(s).\";s:18:\"webr_disable_check\";s:18:\"Disable Validation\";s:14:\"webr_edit_item\";s:12:\"Edit Weblink\";s:9:\"webr_edit\";s:12:\"Edit Weblink\";s:16:\"webr_fillout_all\";s:36:\"Please fill out all required fields.\";s:17:\"webr_item_updated\";s:19:\"Saved modifications\";s:9:\"webr_join\";s:18:\"Subscribe Weblinks\";s:21:\"webr_last_check_table\";s:11:\"Last check:\";s:15:\"webr_last_check\";s:10:\"Last check\";s:10:\"webr_leave\";s:20:\"Unsubscribe Weblinks\";s:19:\"webr_modified_items\";s:20:\"Saved modifications.\";s:18:\"webr_never_checked\";s:13:\"Never checked\";s:8:\"webr_new\";s:15:\"Add New Weblink\";s:21:\"webr_no_items_created\";s:19:\"No Weblinks created\";s:22:\"webr_sure_delete_items\";s:54:\"Do you really want to delete the following Weblink(s)?\";s:4:\"webr\";s:7:\"Weblink\";s:11:\"webservices\";s:11:\"Webservices\";s:4:\"week\";s:4:\"Week\";s:6:\"weekly\";s:6:\"weekly\";s:5:\"weeks\";s:5:\"Weeks\";s:7:\"welcome\";s:7:\"Welcome\";s:13:\"who_is_online\";s:14:\"Who is online?\";s:14:\"width_x_height\";s:14:\"Width x Height\";s:5:\"width\";s:5:\"Width\";s:8:\"wiki_add\";s:8:\"Add Wiki\";s:8:\"wiki_new\";s:8:\"New Wiki\";s:4:\"wiki\";s:4:\"Wiki\";s:4:\"with\";s:4:\"with\";s:18:\"wizard_search_list\";s:67:\"Your search produced the following hits. Please select one of them.\";s:17:\"wizard_title_info\";s:59:\"Plea