t again to change your answers. Do you really want to finish the test?\";s:32:\"tst_finish_notification_advanced\";s:39:\"Send complete test result to test owner\";s:26:\"tst_finish_notification_no\";s:58:\"Don\'t send a mail notification when a user finishes a test\";s:30:\"tst_finish_notification_simple\";s:44:\"Send user name and finish date to test owner\";s:23:\"tst_finish_notification\";s:18:\"Mail on completion\";s:12:\"tst_finished\";s:8:\"Finished\";s:34:\"tst_fixed_participants_data_exists\";s:109:\"There are already participants who ran the test. You are not allowed to change the fixed participants status!\";s:42:\"tst_fixed_participants_disable_description\";s:182:\"You are about to disable the support for fixed participants in this test. All fixed participants who did not start the test yet will be removed from the test. Do you want to proceed?\";s:30:\"tst_fixed_participants_disable\";s:21:\"Confirm Status Change\";s:29:\"tst_fixed_participating_users\";s:31:\"Fixed Participants in this Test\";s:22:\"tst_general_properties\";s:16:\"General Settings\";s:16:\"tst_generate_xls\";s:14:\"Generate Excel\";s:19:\"tst_heading_scoring\";s:7:\"Scoring\";s:37:\"tst_hide_previous_results_description\";s:102:\"If checked, the previous results of a learner will not be used as default values in future test passes\";s:30:\"tst_hide_previous_results_hide\";s:41:\"Hide my results from a previous test pass\";s:38:\"tst_hide_previous_results_introduction\";s:118:\"If you\'re processing more than one pass of this test, your previous entered results will not be used as default values\";s:25:\"tst_hide_previous_results\";s:21:\"Hide Previous Results\";s:18:\"tst_hide_side_list\";s:18:\"Hide question list\";s:19:\"tst_import_no_items\";s:45:\"Error: The import file contains no questions!\";s:33:\"tst_import_verify_found_questions\";s:123:\"ILIAS found the following questions in the test import file. Please select the questions you want to import with this test.\";s:34:\"tst_in_use_edit_questions_disabled\";s:97:\"The test is in use by %d user(s). You are not allowed to edit or move the questions in this test!\";s:27:\"tst_insert_missing_question\";s:63:\"Please select at least one question to insert it into the test!\";s:32:\"tst_insert_questions_and_results\";s:194:\"This test was already executed by %s user(s). Inserting questions to this test will remove all test results of these users. Are you sure you want to insert the following question(s) to the test?\";s:20:\"tst_insert_questions\";s:70:\"Are you sure you want to insert the following question(s) to the test?\";s:36:\"tst_instant_feedback_answer_specific\";s:29:\"Show Answer-Specific Feedback\";s:35:\"tst_instant_feedback_answer_generic\";s:39:\"Show Generic (\"Correct/Wrong\") Feedback\";s:32:\"tst_instant_feedback_description\";s:539:\"If one of the options is selected, the instant feedback information will be shown directly after a participant answered a question. If answer-specific feedback is selected, the predefined feedback will be shown, depending on the answers of the participant (if supported by the question type). The generic feedback prints a simple \"right\" or \"wrong\" feedback according to configuration of the question. If results (in points) are selected, the reached points will be shown. If solutions are selected, the correct solution will be shown too.\";s:28:\"tst_instant_feedback_results\";s:26:\"Show Results (Only Points)\";s:29:\"tst_instant_feedback_solution\";s:14:\"Show Solutions\";s:20:\"tst_instant_feedback\";s:16:\"Instant Feedback\";s:24:\"tst_instant_verification\";s:20:\"Instant Verification\";s:16:\"tst_introduction\";s:20:\"Introductory Message\";s:18:\"tst_invited_nobody\";s:68:\"No users, groups or roles have been added as fixed test participants\";s:27:\"tst_invited_selected_groups\";s:62:\"The selected groups have been added as fixed test participants\";s:26:\"tst_invited_selected_roles\";s:61:\"The selected roles have been added as fixed test participants\";s:26:\"tst_invited_selected_users\";s:61:\"The selected users have been added as fixed test participants\";s:24:\"tst_list_of_answers_show\";s:20:\"Show List of Answers\";s:19:\"tst_list_of_answers\";s:15:\"List of Answers\";s:25:\"tst_list_of_questions_end\";s:65:\"Show the List of Questions before a participant finishes the test\";s:27:\"tst_list_of_questions_start\";s:54:\"Show the List of Questions prior to the first question\";s:38:\"tst_list_of_questions_with_description\";s:55:\"Show the question descriptions in the List of Questions\";s:25:\"tst_list_of_questions_yes\";s:19:\"Yes, and additional\";s:29:\"tst_mark_create_new_mark_step\";s:20:\"Create New Mark Step\";s:34:\"tst_mark_create_simple_mark_schema\";s:25:\"Create Simple Mark Schema\";s:22:\"tst_mark_minimum_level\";s:20:\"Minimum Level (in %)\";s:22:\"tst_mark_official_form\";s:13:\"Official Form\";s:15:\"tst_mark_passed\";s:6:\"Passed\";s:19:\"tst_mark_short_form\";s:10:\"Short Form\";s:8:\"tst_mark\";s:4:\"Mark\";s:29:\"tst_max_allowed_users_heading\";s:70:\"The maximum number of simultaneous users in this test has been reached\";s:29:\"tst_max_allowed_users_message\";s:264:\"The maximum number of simultaneous active users in the test has been reached. Please try again later to start or resume the test. If one of the active users is inactive for more than %s seconds, you may be able to enter this test. Thank you for your understanding.\";s:21:\"tst_max_allowed_users\";s:24:\"Participants Restriction\";s:18:\"tst_maximum_points\";s:14:\"Maximum Points\";s:18:\"tst_missing_author\";s:89:\"You have not entered the authors name in the test properties! Please add an authors name.\";s:17:\"tst_missing_marks\";s:96:\"You do not have a mark schema in the test! Please add at least a simple mark schema to the test.\";s:21:\"tst_missing_questions\";s:90:\"You do not have any questions in the test! Please add at least one question into the test.\";s:17:\"tst_missing_title\";s:87:\"You have not entered a test title! Please go to the metadata section and enter a title.\";s:23:\"tst_must_be_online_exam\";s:47:\"This option is only available for online exams!\";s:22:\"tst_no_evaluation_data\";s:38:\"There is no evaluation data available.\";s:24:\"tst_no_export_randomtest\";s:172:\"You cannot export a test with random selection of questions, because every used question pool has to be exported too which leads to enormous complexity of the export files.\";s:20:\"tst_no_marks_defined\";s:72:\"There are no marks defined, please create at least a simple mark schema!\";s:35:\"tst_no_more_available_questionpools\";s:42:\"There are no more question pools available\";s:36:\"tst_no_question_selected_for_removal\";s:48:\"Please check at least one question to remove it!\";s:36:\"tst_no_questionpools_for_random_test\";s:98:\"You have not added a question pool for this random test! Please select at least one question pool.\";s:26:\"tst_no_questions_available\";s:91:\"There are no questions available! You need to create new questions or browse for questions.\";s:32:\"tst_no_questions_for_random_test\";s:170:\"You have taken no questions from the questionspools for this random test! Please take at least one question by setting the amount of questions for an added question pool.\";s:25:\"tst_no_solution_available\";s:55:\"Short answer questions don\'t have a specified solution.\";s:18:\"tst_no_taken_tests\";s:25:\"There are no taken tests!\";s:12:\"tst_no_tries\";s:4:\"none\";s:16:\"tst_nr_of_passes\";s:21:\"Number of Test Passes\";s:23:\"tst_nr_of_tries_of_user\";s:24:\"Passes Already Completed\";s:15:\"tst_nr_of_tries\";s:21:\"Max. Number of Passes\";s:25:\"tst_participants_no_fixed\";s:62:\"There is nobody assigned as a fixed participant for this test!\";s:19:\"tst_participants_no\";s:38:\"Nobody has started the test right now!\";s:23:\"tst_participating_users\";s:19:\"Participating Users\";s:18:\"tst_pass_best_pass\";s:19:\"Score the Best Pass\";s:16:\"tst_pass_details\";s:12:\"Pass Details\";s:18:\"tst_pass_last_pass\";s:19:\"Score the Last Pass\";s:28:\"tst_pass_scoring_description\";s:301:\"If the last pass is scored, the last test pass of a participant will be used to calculate the test results. If the best pass is scored, the test pass with the highest number of reached points will be chosen a test result. This setting only has effect, if more than one test pass is allowed for a test.\";s:16:\"tst_pass_scoring\";s:21:\"Multiple Pass Scoring\";s:10:\"tst_passes\";s:11:\"Test Passes\";s:20:\"tst_password_details\";s:101:\"If you define a test password, all users with test access must enter this password to start the test.\";s:35:\"tst_password_entered_wrong_password\";s:70:\"You cannot start the test because you entered the wrong test password!\";s:25:\"tst_password_introduction\";s:101:\"This test can only be accessed with a test password. Please enter the test password to start the test\";s:12:\"tst_password\";s:13:\"Test Password\";s:18:\"tst_percent_solved\";s:14:\"Percent Solved\";s:12:\"tst_position\";s:17:\"Question %s of %s\";s:24:\"tst_postpone_description\";s:63:\"The participants may postpone questions to the end of the test.\";s:12:\"tst_postpone\";s:18:\"Postpone Questions\";s:14:\"tst_print_date\";s:13:\"Date of Print\";s:9:\"tst_print\";s:32:\"Test and Assessment - Print View\";s:24:\"tst_processing_time_desc\";s:365:\"The countdown of the maximum processing time begins at the moment when a user starts a test for the first time and ends after the expiration of the entered period of time. If this option is used, the possibility to suspend a test should be deactivated (see \'Sequence Settings\') because suspending the test does not stop the countdown of the maximum processing time.\";s:19:\"tst_processing_time\";s:20:\"Max. Processing Time\";s:14:\"tst_properties\";s:15:\"Test Properties\";s:13:\"tst_qst_order\";s:5:\"Order\";s:19:\"tst_qst_resetsolved\";s:12:\"Set Unsolved\";s:20:\"tst_qst_result_sheet\";s:17:\"Show Result Sheet\";s:17:\"tst_qst_setsolved\";s:10:\"Set Solved\";s:20:\"tst_qst_summary_text\";s:75:\"Here you can see all questions. Use the bulbs to mark a question as solved.\";s:17:\"tst_question_mark\";s:18:\"Mark this question\";s:19:\"tst_question_marked\";s:23:\"You marked the question\";s:19:\"tst_question_marker\";s:6:\"Marker\";s:15:\"tst_question_no\";s:5:\"Order\";s:18:\"tst_question_offer\";s:53:\"Do you accept this sample or do you want another one?\";s:34:\"tst_question_selection_description\";s:287:\"If you only use question pools which contain questions with an equal maximum number of available points, the test will have an equal number of maximum points for all participating users and thus the test results will be better comparable. It is recommended to choose this selection mode.\";s:28:\"tst_question_selection_equal\";s:44:\"Use question pools with equal maximum points\";s:22:\"tst_question_selection\";s:18:\"Question Selection\";s:18:\"tst_question_title\";s:5:\"Title\";s:17:\"tst_question_type\";s:13:\"Question Type\";s:19:\"tst_question_unmark\";s:33:\"Remove the mark for this question\";s:22:\"tst_questions_inserted\";s:21:\"Question(s) inserted!\";s:21:\"tst_questions_removed\";s:20:\"Question(s) removed!\";s:26:\"tst_random_nr_of_questions\";s:19:\"How many questions?\";s:25:\"tst_random_qpl_unselected\";s:90:\"There is at least one unselected question pool! You don\'t need to add a new question pool.\";s:24:\"tst_random_questionpools\";s:21:\"Source Question Pools\";s:30:\"tst_random_select_questionpool\";s:53:\"Select the question pool to choose the questions from\";s:44:\"tst_random_selection_question_count_too_high\";s:140:\"The question count you entered was higher than the maximum number of available questions. The question count has been reduced automatically.\";s:50:\"tst_random_selection_question_total_count_too_high\";s:172:\"The question count you entered was higher than the maximum number of available questions for all selected question pools. The question count has been reduced automatically.\";s:20:\"tst_random_selection\";s:29:\"Random Selection of Questions\";s:27:\"tst_random_test_description\";s:142:\"If checked, the questions of the test will be chosen randomly from question pools. ILIAS generates a new random selection for every test pass.\";s:15:\"tst_random_test\";s:11:\"Random Test\";s:18:\"tst_reached_points\";s:14:\"Reached Points\";s:15:\"tst_remove_mark\";s:16:\"Remove this mark\";s:32:\"tst_remove_questions_and_results\";s:197:\"This test was already executed by %s user(s). Removing questions from this test will remove all test results of these users. Are you sure you want to remove the following question(s) from the test?\";s:20:\"tst_remove_questions\";s:70:\"Are you sure you want to remove the following questions from the test?\";s:21:\"tst_report_after_date\";s:34:\"After a fixed score reporting date\";s:31:\"tst_report_after_first_question\";s:49:\"Offer test results when the test has been started\";s:25:\"tst_report_after_question\";s:37:\"Allow instant verification of answers\";s:21:\"tst_report_after_test\";s:44:\"Offer test results when the test is finished\";s:16:\"tst_report_never\";s:25:\"No test results available\";s:30:\"tst_reset_processing_time_desc\";s:224:\"If checked, the maximum processing time will be reset back to the defined maximum processing time after a test pass has been finished. This setting only works with an enabled maximum processing time and multiple test passes.\";s:25:\"tst_reset_processing_time\";s:53:\"Reset the maximum processing time for every test pass\";s:25:\"tst_result_user_name_pass\";s:30:\"Results of Test Pass %s for %s\";s:20:\"tst_result_user_name\";s:19:\"Test Results for %s\";s:25:\"tst_results_access_always\";s:6:\"Always\";s:23:\"tst_results_access_date\";s:4:\"Date\";s:30:\"tst_results_access_description\";s:818:\"This setting handles the access of the participants to their test results. If results can be accessed after the test is finished, the participants can access their test results after they finished a test pass for the first time. Even if a test has more than one allowed test pass, the participants can access their test results after finishing the first pass. If you choose a date access restriction, the participants will not be able to access their test results until the specified date and time is reached. You must choose this option if you want to use the ECTS scoring system of if you have to score questions manually. If \"Always\" is selected, the participants can access their test results at any time even if the did not finish the test yet. If \"Never\" is selected, the access to test results is not available.\";s:27:\"tst_results_access_finished\";s:22:\"After Test is Finished\";s:24:\"tst_results_access_never\";s:5:\"Never\";s:18:\"tst_results_access\";s:22:\"Access to Test Results\";s:22:\"tst_results_aggregated\";s:23:\"Aggregated Test Results\";s:27:\"tst_results_back_evaluation\";s:27:\"Back to Evaluation Overview\";s:29:\"tst_results_back_introduction\";s:28:\"Back to Introductory Message\";s:25:\"tst_results_back_overview\";s:24:\"Back to Results Overview\";s:25:\"tst_results_overview_pass\";s:28:\"Results Overview for Pass %s\";s:20:\"tst_results_overview\";s:33:\"Pass Overview of the Test Results\";s:36:\"tst_results_presentation_description\";s:1277:\"If \"Show Pass Details for running tests\" is selected, the question titles and the reached points for every question in the test pass are available if the test is not finished. If \"Show Solutions in Test Results\" is selected, the detailed question solution is available for participants in the test results presentation. This includes the exact scoring of every answer, otherwise only an overview with the question titles and the reached points is shown. If the list of answers is selected, an overview of all questions with the answers of the participant is generated. This list will be offered on the Info Page and at the end of a test prior to the final submission. If \"Show Answer-Specific Feedback in Test Results\" is selected, the answer specific feedback will be shown in the test results next to the questions. If \"Results print view (answers only)\" is selected, the ILIAS content you place around a question using the \"Edit content\" tab page will not be visible in a print-out. If you want to save some paper space, select this option. If \"Show Signature Placeholder\" is selected, a signature placeholder will be shown for printout. If \"Show Suggested Solution\" is selected, the suggested solutions of questions (if existent) will be shown in the test results overview.\";s:24:\"tst_results_presentation\";s:25:\"Test Results Presentation\";s:11:\"tst_results\";s:12:\"Test Results\";s:15:\"tst_resume_test\";s:15:\"Resume the Test\";s:22:\"tst_score_cut_question\";s:32:\"Cut off Negative Question Points\";s:18:\"tst_score_cut_test\";s:28:\"Cut off Negative Test Points\";s:29:\"tst_score_cutting_description\";s:315:\"If Negative Question Points are cut off, the results for each question that a participant answers with a result of less than zero points will be set to zero points. If Negative Test Points are cut off, the results for the test will be set to zero points, if the sum of all question results is less than zero points.\";s:17:\"tst_score_cutting\";s:23:\"Cut off Negative Points\";s:36:\"tst_score_mcmr_questions_description\";s:219:\"If \"Score 0 Points for Unchecked Answers\" is selected, multiple choice questions without a selected check box will be scored with zero points, otherwise every check box will be scored dependent to the predefined points.\";s:24:\"tst_score_mcmr_questions\";s:25:\"Multiple Choice Questions\";s:33:\"tst_score_mcmr_use_scoring_system\";s:21:\"Use the Defined Score\";s:42:\"tst_score_mcmr_zero_points_when_unanswered\";s:36:\"Score 0 Points for Unchecked Answers\";s:24:\"tst_score_reporting_date\";s:20:\"Score Reporting Date\";s:19:\"tst_score_reporting\";s:15:\"Score Reporting\";s:14:\"tst_score_type\";s:20:\"Score Reporting Type\";s:26:\"tst_select_file_for_import\";s:34:\"You must select a file for import!\";s:15:\"tst_select_qpls\";s:45:\"Please select a question pool for duplication\";s:23:\"tst_select_questionpool\";s:59:\"Please select a question pool to store the created question\";s:24:\"tst_select_questionpools\";s:61:\"Please select a question pool to store the imported questions\";s:27:\"tst_select_random_questions\";s:75:\"Select the question pool(s) and the amount of questions for the random test\";s:15:\"tst_select_tsts\";s:36:\"Please select a test for duplication\";s:30:\"tst_selected_user_data_deleted\";s:62:\"The test data of the selected user(s) was deleted successfully\";s:18:\"tst_sequence_fixed\";s:34:\"The Sequence of Questions is Fixed\";s:21:\"tst_sequence_postpone\";s:52:\"Questions may be postponed to the end of a test pass\";s:23:\"tst_sequence_properties\";s:17:\"Sequence Settings\";s:12:\"tst_sequence\";s:8:\"Sequence\";s:20:\"tst_session_settings\";s:16:\"Session Settings\";s:21:\"tst_show_answer_sheet\";s:12:\"Show Answers\";s:27:\"tst_show_cancel_description\";s:214:\"If checked, a button to suspend the test is shown during test run. Do not use this option when running a test with maximum processing time. Suspending the test does not stop the maximum processing time\'s countdown.\";s:15:\"tst_show_cancel\";s:24:\"Show Suspend Test Option\";s:21:\"tst_show_pass_details\";s:35:\"Show Pass Details for Running Tests\";s:16:\"tst_show_results\";s:17:\"Show Test Results\";s:18:\"tst_show_side_list\";s:24:\"Show question list aside\";s:30:\"tst_show_solution_answers_only\";s:36:\"Print View of Results (Answers Only)\";s:25:\"tst_show_solution_details\";s:30:\"Show Solutions in Test Results\";s:26:\"tst_show_solution_feedback\";s:45:\"Show Answer-Specific Feedback in Test Results\";s:27:\"tst_show_solution_printview\";s:20:\"Show List of Answers\";s:27:\"tst_show_solution_signature\";s:26:\"Show Signature Placeholder\";s:27:\"tst_show_solution_suggested\";s:23:\"Show Suggested Solution\";s:28:\"tst_show_summary_description\";s:90:\"Offers a list with all test questions available for the test participants during the test.\";s:16:\"tst_show_summary\";s:22:\"Show List of Questions\";s:33:\"tst_shuffle_questions_description\";s:54:\"Shuffle the sequence of questions for every test pass.\";s:21:\"tst_shuffle_questions\";s:17:\"Shuffle Questions\";s:13:\"tst_signature\";s:9:\"Signature\";s:18:\"tst_single_results\";s:19:\"Results by Question\";s:23:\"tst_start_new_test_pass\";s:19:\"Start New Test Pass\";s:14:\"tst_start_test\";s:14:\"Start the Test\";s:11:\"tst_started\";s:12:\"Test Started\";s:17:\"tst_starting_time\";s:13:\"Starting Time\";s:18:\"tst_stat_all_users\";s:16:\"All Participants\";s:21:\"tst_stat_choose_users\";s:45:\"(select one or more users from the user list)\";s:27:\"tst_stat_result_atimeofwork\";s:20:\"Average Time of Work\";s:28:\"tst_stat_result_distancemean\";s:27:\"Distance to Arithmetic Mean\";s:30:\"tst_stat_result_distancemedian\";s:18:\"Distance to Median\";s:32:\"tst_stat_result_distancequintile\";s:31:\"Distance to Arithmetic Quintile\";s:26:\"tst_stat_result_firstvisit\";s:11:\"First Visit\";s:25:\"tst_stat_result_lastvisit\";s:10:\"Last Visit\";s:27:\"tst_stat_result_mark_median\";s:14:\"Mark of Median\";s:22:\"tst_stat_result_median\";s:31:\"Median of Test Result in Points\";s:30:\"tst_stat_result_pworkedthrough\";s:48:\"Percent of total workload already worked through\";s:20:\"tst_stat_result_qmax\";s:25:\"Total number of Questions\";s:30:\"tst_stat_result_qworkedthrough\";s:32:\"Questions already worked through\";s:27:\"tst_stat_result_rank_median\";s:14:\"Rank of Median\";s:32:\"tst_stat_result_rank_participant\";s:19:\"Rank of Participant\";s:28:\"tst_stat_result_resultsmarks\";s:21:\"Test Results in Marks\";s:29:\"tst_stat_result_resultspoints\";s:22:\"Test Results in Points\";s:29:\"tst_stat_result_specification\";s:25:\"Available Evaluation Data\";s:26:\"tst_stat_result_timeofwork\";s:12:\"Time of Work\";s:34:\"tst_stat_result_total_participants\";s:28:\"Total Number of Participants\";s:23:\"tst_stat_selected_users\";s:21:\"Selected Participants\";s:20:\"tst_stat_users_intro\";s:31:\"Show Statistical Evaluation for\";s:40:\"tst_status_completed_more_tries_possible\";s:9:\"Completed\";s:20:\"tst_status_completed\";s:9:\"completed\";s:27:\"tst_status_missing_elements\";s:35:\"The following elements are missing:\";s:18:\"tst_status_missing\";s:49:\"There are required elements missing in this test!\";s:22:\"tst_status_not_entered\";s:11:\"Not started\";s:13:\"tst_status_ok\";s:60:\"The status of the test is OK. There are no missing elements.\";s:19:\"tst_status_progress\";s:11:\"In progress\";s:22:\"tst_submit_answers_txt\";s:55:\"You now may finish the test by submitting your answers.\";s:18:\"tst_submit_answers\";s:32:\"Yes, I want to submit my answers\";s:18:\"tst_submit_results\";s:33:\"Yes, I do confirm the submission.\";s:15:\"tst_test_output\";s:11:\"Test Output\";s:21:\"tst_text_count_system\";s:14:\"Scoring System\";s:27:\"tst_time_already_spent_left\";s:17:\"You have %s left.\";s:22:\"tst_time_already_spent\";s:63:\"You started the test at %s. Your maximum processing time is %s.\";s:28:\"tst_title_output_description\";s:117:\"Select one of the above options for the presentation of the question titles and the available points during the test.\";s:21:\"tst_title_output_full\";s:41:\"Show Question Titles and Available Points\";s:28:\"tst_title_output_hide_points\";s:25:\"Show only Question Titles\";s:25:\"tst_title_output_no_title\";s:55:\"Don\'t show the Question Titles and the Available Points\";s:16:\"tst_title_output\";s:21:\"Question Title Output\";s:31:\"tst_total_questions_description\";s:183:\"If you set this value, the amount of questions entered with the question pools are ignored. If you don\'t set this value, you need to enter an amount with every sel