INSERT INTO `lng_modules` VALUES ('survey','en','a:656:{s:12:\"add_category\";s:10:\"Add Answer\";s:11:\"add_heading\";s:11:\"Add Heading\";s:31:\"add_limits_for_standard_numbers\";s:89:\"Please enter a lower and upper limit for the standard numbers you want to add as answers.\";s:12:\"add_material\";s:12:\"Add Material\";s:23:\"add_phrase_introduction\";s:23:\"Please select a Phrase:\";s:10:\"add_phrase\";s:10:\"Add Phrase\";s:20:\"add_standard_numbers\";s:20:\"Add Standard Numbers\";s:20:\"adm_no_special_users\";s:79:\"There are no special users defined who are able to run a survey more than once.\";s:18:\"adm_no_users_found\";s:49:\"No users were found that match the search string.\";s:22:\"adm_remove_select_user\";s:44:\"Please select at least one user for removal!\";s:17:\"adm_removed_users\";s:13:\"Users removed\";s:22:\"adm_search_select_user\";s:32:\"Please select at least one user!\";s:27:\"adm_search_string_too_small\";s:57:\"Please enter at least two characters in the search field!\";s:17:\"adm_special_users\";s:57:\"Special users who are able to run a survey more than once\";s:24:\"already_completed_survey\";s:81:\"You have already finished the survey! You are not able to enter the survey again.\";s:13:\"anonymization\";s:13:\"Anonymization\";s:32:\"anonymize_anonymous_introduction\";s:222:\"This survey anonymizes all user data. To grant you access to the survey, you must use a 5-character survey code which you can receive from the creator/maintainer of this survey<br />Please enter it in the text field above.\";s:26:\"anonymize_key_introduction\";s:330:\"This survey anonymizes all user data. To grant you access to the survey, a 5-character code was created by the system and will be sent to your ILIAS mail inbox when you start the survey (after answering the first question). Your survey access code is<br /><span class=\"bold\">%s</span><br />Please enter it in the text field below.\";s:22:\"anonymize_personalized\";s:16:\"No Anonymization\";s:25:\"anonymize_registered_user\";s:24:\"Anonymized Survey Access\";s:29:\"anonymize_resume_introduction\";s:124:\"Please enter your survey access code to resume the survey. It was sent to your ILIAS mail inbox when you started the survey.\";s:28:\"anonymize_survey_description\";s:307:\"Anonymization removes any personal data from the survey statistics. A survey code is a five digit code which is needed to take part in an anonymized survey. For registered ILIAS users, a survey code will be generated automatically if the option \"Access with survey codes for unregistered users\" is selected.\";s:19:\"anonymize_with_code\";s:34:\"Anonymous Survey with Access Codes\";s:23:\"anonymize_with_code_all\";s:38:\"Access with survey codes for all users\";s:22:\"anonymize_without_code\";s:16:\"Anonymous Survey\";s:34:\"anonymous_with_personalized_survey\";s:59:\"You must be a registered user to run a personalized survey!\";s:6:\"answer\";s:6:\"Answer\";s:5:\"apply\";s:5:\"Apply\";s:15:\"arithmetic_mean\";s:15:\"Arithmetic Mean\";s:25:\"ask_insert_questionblocks\";s:78:\"Are you sure you want to insert the following question block(s) to the survey?\";s:20:\"ask_insert_questions\";s:72:\"Are you sure you want to insert the following question(s) to the survey?\";s:4:\"back\";s:7:\"<< Back\";s:6:\"before\";s:6:\"before\";s:20:\"browse_for_questions\";s:13:\"Add from Pool\";s:13:\"cancel_survey\";s:18:\"Suspend the Survey\";s:26:\"cannot_create_survey_codes\";s:72:\"You do not possess sufficient permissions to create survey access codes!\";s:18:\"cannot_edit_survey\";s:61:\"You do not possess sufficient permissions to edit the survey!\";s:26:\"cannot_export_questionpool\";s:77:\"You do not possess sufficient permissions to export the survey question pool!\";s:20:\"cannot_export_survey\";s:63:\"You do not possess sufficient permissions to export the survey!\";s:22:\"cannot_maintain_survey\";s:65:\"You do not possess sufficient permissions to maintain the survey!\";s:21:\"cannot_manage_phrases\";